import './App.css';
import Navbar from "./layout/Navbar";
import 'bootstrap/dist/css/bootstrap.min.css';
import Home from "./pages/Home";
import {BrowserRouter} from "react-router-dom";

function App() {
  return (
    <div className="App">
        <BrowserRouter>
            <Navbar/>
            <Home/>
        </BrowserRouter>
    </div>
  );
}

export default App;
